sys_variable_value.value:
(function execute(inputs, outputs) {
    //remove whitespace from input strings
    var bambooUtils = new BambooUtils();
    inputs = bambooUtils.trimStringInputs(inputs);
    outputs.bamboo_project = inputs.bamboo_project;
    outputs.bamboo_plan = inputs.bamboo_plan;
    outputs.bamboo_stage = inputs.bamboo_stage;
    outputs.execute_all_stages = inputs.execute_all_stages;
    outputs.vcs_revision = inputs.vcs_revision;
  })(inputs, outputs);

